        "scryptsy": "^2.1.0",
        "snackbarjs": "^1.1.0",
        "sortablejs": "^1.15.2",
        "split.js": "^1.6.5",
        "ssdeep.js": "0.0.3",
        "stream-browserify": "^3.0.0",
        "tesseract.js": "5.1.0",
        "ua-parser-js": "^1.0.38",
        "unorm": "^1.6.0",
